import React from 'react'

export default function MovieInfo(props) {

  const movie = props.data;
  console.log(movie)
  if(props.clicked !== true){
    return (
      <div>
        <body>
          {props.data.map((movie, index) => {
                return(
                  <p key={index}>{movie.title}</p>
                );
            })
          }
        </body>
      </div>
    )  
  }
  else{
    return;
  }
}
